struct Grid
  x::Vector{Float64}
  y::Vector{Float64}
  z::Vector{Float64}
end

function Base.show(io::IO, grid::Grid)
  print(io, "Grid(")
  print(io, length(grid.x), " × ")
  print(io, length(grid.y), " × ")
  print(io, length(grid.z), ")")
end
